        double IQuantity.As(Enum unit)
        {
            if (unit is not FrequencyUnit typedUnit)
                throw new ArgumentException($"The given unit is of type {unit.GetType()}. Only {typeof(FrequencyUnit)} is supported.", nameof(unit));

